import React from 'react';
import { Navbar, Nav, Container, Button, Image } from 'react-bootstrap';
import './Navbar.css'; 

// Import SVG files
import arrowLeftIcon from '../assets/icons/arrow-left.svg';
import plusIcon from '../assets/icons/plus.svg';
import downloadIcon from '../assets/icons/download.svg';
import AvatarIcon from '../assets/icons/avatar.svg';
import threeDotsIcon from '../assets/icons/threedots.svg';




function AppNavbar() {
  return (
    <Navbar bg="white" expand="lg" className="pt-4 pb-5">
      <Container fluid>
        <Nav className="align-items-center">
          <Nav.Link href="#" className="p-0">
            <img src={arrowLeftIcon} alt="Back" width="24" height="24" />
          </Nav.Link>
          <div className="divider-nav mx-3"></div>
          <img src={AvatarIcon} alt="Avatar" width="32" height="32" className="me-2 rounded-circle" />

          <Navbar.Text className="p-0 me-3">Alia Bhatt</Navbar.Text>
          <span className="badge bg-primary badge-custom-padding">4 updates</span>
        </Nav>
        <Nav className="ms-auto d-flex align-items-center">
          <Button variant="primary" className="rounded-circle btn-custom-circle me-4">
            <img src={plusIcon} alt="Add" width="14" height="14" />
          </Button>
          <Button variant="outline-primary" className="me-4 btn-custom-padding">
            <img src={downloadIcon} alt="Download" width="16" height="16" className="me-2" />
            Generate report
          </Button>
          <div className="divider-nav me-4"></div>
          <Button variant="light" className="p-0">
            <img src={threeDotsIcon} alt="More" width="20" height="20" />
          </Button>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default AppNavbar;
